import React from "react";
import { Link } from "react-router-dom";
import { DropdownButton, ButtonGroup, Dropdown } from 'react-bootstrap';

function Navbar() {
  return (
    <div>
      <>
        {['Info'].map(
          (variant) => (
            <DropdownButton
              as={ButtonGroup}
              key={variant}
              id={`dropdown-variants-${variant}`}
              variant={variant.toLowerCase()}
              title="Menu"
            >
              <Dropdown.Item eventKey="home" href="https://www.google.com">
                <Link to="/">Home</Link>
              </Dropdown.Item>
              <Dropdown.Item eventKey="about">
                <Link to="/about">About</Link>
              </Dropdown.Item>
              <Dropdown.Item eventKey="projects">
                <Link to="/projects">Projects</Link>
              </Dropdown.Item>
              <Dropdown.Item eventKey="contact">
                <Link to="/contact">Contact</Link>
              </Dropdown.Item>
              <Dropdown.Divider />
              <Dropdown.Item eventKey="resume">
                <a href=""> Resume </a>
              </Dropdown.Item>
            </DropdownButton>
          ),
        )}
      </>

    </div>

  );
}

export default Navbar;
